from app.mktcore.mdlimports import *

class MKT_SUB_LOAN_DE(exmodel):
	ID 				= db.Column(db.String(25), primary_key=True, index=True)
	LoanID			= db.Column(db.String(15))
	Currency		= db.Column(db.String(3))
	CustomerName	= db.Column(db.String(50))
	Gender			= db.Column(db.String(1))
	DisburseDate	= db.Column(db.String(10))
	MaturityDate	= db.Column(db.String(10))
	DisburseAmt		= db.Column(db.Numeric(25, 9))
	OutstandingAmt	= db.Column(db.Numeric(25, 9))
	Tenure			= db.Column(db.String(5))
	FutureValue		= db.Column(db.Numeric(25, 9))
	FutureValueAmt	= db.Column(db.Numeric(25, 9))
	Installment		= db.Column(db.Numeric(25, 9))
	PlateNo			= db.Column(db.String(15), index=True)
	EndOf03Cycle	= db.Column(db.Numeric(25, 9))
	EndOf06Cycle	= db.Column(db.Numeric(25, 9))
	EndOf09Cycle	= db.Column(db.Numeric(25, 9))
	EndOf12Cycle	= db.Column(db.Numeric(25, 9))
	EndOf15Cycle	= db.Column(db.Numeric(25, 9))
	Description		= db.Column(db.String(50))


